import RPi.GPIO as GPIOimport timeGPIO.setmode(GPIO.BCM)GPIO.setup(13, GPIO.OUT)p = GPIO.PWM(13, 50)  # PWM frequency is 50Hzp.start(2.5)  # Initializationtry:    while True:        p.ChangeDutyCycle(5)  # Rotate the servo motor to 90 degrees        print("he1")        time.sleep(2)        p.ChangeDutyCycle(7.5)  # Rotate the servo motor to 180 degrees        print("he11")        time.sleep(1)                p.ChangeDutyCycle(10)  # Rotate the servo motor to 90 degrees        print("he1")        time.sleep(2)        p.ChangeDutyCycle(7.5)  # Rotate the servo motor to 180 degrees        print("he11")        time.sleep(1)except KeyboardInterrupt:    p.stop()    GPIO.cleanup()